actionConfiguration.body:
(tab) => {
		  let carbohydrateSum = 0;
			const mealData = tab == 'all' ? getMeal_Insights_of_the_Day.data : getMeal_Insights_of_the_Day.data.filter((obj) => obj.mealType === tab)
		  _.forEach(mealData, function(meal) {
  		carbohydrateSum = carbohydrateSum + parseFloat(meal.carbohydrate)
			});
		return carbohydrateSum.toFixed(1);
	}

